import React from 'react';

import self from '../img/self.png';

export let colors = ["rgb(185, 85, 211)", "rgb(247, 10, 7)"];
// use gradient generator to get this

export const info = {
    firstName: "John",
    initials: "js",
    position: "Full Stack Developer",
    selfPortrait: self,
    gradient: `linear-gradient(135deg, ${colors})`,
    miniBio: [
        ["☕️", "Fueled by coffee"],
        ["🇺🇸", "Based in the US"],
        ["💼", "Systems Engineer at Google"],
        ["✉️", "johnsmith@gmail.com"],
    ],
    socials: [
        ["https://facebook.com/", facebookIcon()],
        ["https://instagram.com/", instagramIcon()],
        ["https://linkedin.com", linkedInIcon()],
        ["https://medium.com", mediumIcon()],
        ["https://twitter.com", twitterIcon()]
    ]
}

function facebookIcon() { return <i className="fa fa-facebook" aria-hidden="true" />};

function instagramIcon() { return <i className="fa fa-instagram" aria-hidden="true" />};

function linkedInIcon() { return <i className="fa fa-linkedin" aria-hidden="true" />};

function mediumIcon() { return <i className="fa fa-medium" aria-hidden="true" />};

function twitterIcon() { return <i className="fa fa-twitter" aria-hidden="true" />};
